My Week with the Gunmen

Sociopolitical Documentary hosted by Peter Oborne, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2012 - English narration


Information
------------------------------

Six months after its revolution, Libya is still riven by factionalism, militias and violence, as the armed groups who overthrew Colonel Gaddafi cling to territory and power. Tripoli's streets are ruled by the gun. The police have tried to remove roadblocks manned by militiamen and have been driven off in a hail of gunfire. Reporter Peter Oborne and director Richard Cookson talk to fighters from the powerful Zintan militia who have controlled the country's main airport since they seized it from Gaddafi forces. They've been involved in tense negotiations with the government about handing it over but the talks appear to have stalled.

